import React from "react";
import { AppBar, Toolbar, Typography } from "@mui/material";

const Navbar = () => {
    return(
        <>
            <AppBar sx={{background: "#063970"}}>
                <Toolbar> 
                    <img src={require('../images/logo.png')} className="menu--logo"/>
                    
                </Toolbar>
            </AppBar>
        </>
        );
}

export default Navbar;
